import './App.css';
import logo from './img/logo.png'

function App() {
  return (
    <div className=" min-h-screen flex items-center justify-between relative">
      <header className="mx-auto p-4 items-center justify-center">
        <div>
          <img src={logo} className="mx-auto rounded-full"/>
        </div>
        <button className="bg-yellow-700 text-white p-2 rounded-md cursor-pointer absolute top-5 right-5 text-xl">
          Sign up
        </button>
      </header>
    </div>
  );
}

export default App;
